import React from 'react';

const PedidoListRow = ({pedido}) => {
  return(
    <tr>
      <td>{pedido.id}</td>
      <td>{pedido.nome}</td>
      <td>{pedido.descricao}</td>
      <td>{pedido.status}</td>
    </tr>
  );
};

export default PedidoListRow;
